{
  "rules": {
    "body-leading-blank": [1, "always"],
    "body-max-line-length": [2, "always", 1000],
    "footer-leading-blank": [1, "always"],
    "footer-max-line-length": [2, "always", 1000],
    "header-max-length": [2, "always", 120],
    "subject-case": [
      2,
      "never",
      ["sentence-case", "start-case", "pascal-case", "upper-case"]
    ],
    "subject-empty": [2, "never"],
    "subject-full-stop": [2, "never", "."],
    "type-case": [2, "always", "lower-case"],
    "type-empty": [2, "never"],
    "type-enum": [
      2,
      "always",
      [
        "build",
        "chore",
        "ci",
        "depr",
        "docs",
        "feat",
        "fix",
        "perf",
        "refactor",
        "revert",
        "style",
        "test"
      ]
    ]
  },
  "prompt": {
    "questions": {
      "type": {
        "description": "Select the type of change that you're committing",
        "enum": {
          "feat": {
            "description": "A new feature",
            "title": "Features",
            "emoji": "✨"
          },
          "fix": {
            "description": "A bug fix",
            "title": "Bug Fixes",
            "emoji": "🐛"
          },
          "docs": {
            "description": "Documentation only changes",
            "title": "Documentation",
            "emoji": "📚"
          },
          "depr": {
            "description": "Deprecated APIs and behaviors",
            "title": "Deprecations",
            "emoji": "⛔"
          },
          "style": {
            "description": "Changes that do not affect the meaning of the code (whitespace, formatting, missing semi-colons, etc)",
            "title": "Styles",
            "emoji": "💎"
          },
          "refactor": {
            "description": "A code change that neither fixes a bug nor adds a feature",
            "title": "Code Refactoring",
            "emoji": "📦"
          },
          "perf": {
            "description": "A code change that improves performance",
            "title": "Performance Improvements",
            "emoji": "🚀"
          },
          "test": {
            "description": "Adding missing tests or fixing existing tests",
            "title": "Tests",
            "emoji": "🚨"
          },
          "build": {
            "description": "Changes that affect the build system or external dependencies (example scopes: poetry, nix)",
            "title": "Builds",
            "emoji": "🛠"
          },
          "ci": {
            "description": "Changes to our CI configuration files and scripts (example scopes: actions, gh-actions, github-actions)",
            "title": "Continuous Integrations",
            "emoji": "⚙️"
          },
          "chore": {
            "description": "Other changes that don't modify source or test files",
            "title": "Chores",
            "emoji": "♻️"
          },
          "revert": {
            "description": "Reverts a previous commit",
            "title": "Reverts",
            "emoji": "🗑"
          }
        }
      },
      "scope": {
        "description": "What is the scope of this change (e.g. component or file name)"
      },
      "subject": {
        "description": "Write a short, imperative tense description of the change"
      },
      "body": {
        "description": "Provide a longer description of the change"
      },
      "isBreaking": {
        "description": "Are there any breaking changes?"
      },
      "breakingBody": {
        "description": "A BREAKING CHANGE commit requires a body. Please enter a longer description of the commit itself"
      },
      "breaking": {
        "description": "Describe the breaking changes"
      },
      "isIssueAffected": {
        "description": "Does this change affect any open issues?"
      },
      "issuesBody": {
        "description": "If issues are closed, the commit requires a body. Please enter a longer description of the commit itself"
      },
      "issues": {
        "description": "Add issue references (e.g. \"fix #123\", \"re #123\".)"
      }
    }
  }
}

"use strict";

const releaseConfig = require("./.releaserc.js");

function extractConventionalCommitsConfig(config) {
  return config.plugins
    .filter(
      ([plugin, _]) => plugin == "@semantic-release/release-notes-generator"
    )
    .map(([_, config]) => config)[0].presetConfig.types;
}

module.exports = {
  options: {
    preset: {
      name: "conventionalcommits",
      types: extractConventionalCommitsConfig(releaseConfig)
    }
  }
};

"use strict";

module.exports = {
  branches: ["main"],
  tagFormat: "${version}",
  preset: "conventionalcommits",
  plugins: [
    [
      "@semantic-release/commit-analyzer",
      {
        // deprecations are patch releases
        releaseRules: [{ type: "depr", release: "patch" }],
        preset: "conventionalcommits"
      }
    ],
    [
      "@semantic-release/release-notes-generator",
      {
        preset: "conventionalcommits",
        presetConfig: {
          types: [
            { type: "feat", section: "Features" },
            { type: "fix", section: "Bug Fixes" },
            { type: "chore", hidden: true },
            { type: "docs", section: "Documentation" },
            { type: "style", hidden: true },
            { type: "refactor", section: "Refactors" },
            { type: "perf", section: "Performance" },
            { type: "test", hidden: true },
            { type: "depr", section: "Deprecations" }
          ]
        }
      }
    ],
    [
      "@semantic-release/changelog",
      {
        changelogTitle: "---\n---",
        changelogFile: "docs/release_notes_generated.qmd"
      }
    ],
    [
      "semantic-release-replace-plugin",
      {
        replacements: [
          {
            files: ["ibis/__init__.py"],
            from: '__version__ = ".*"',
            to: '__version__ = "${nextRelease.version}"',
            results: [
              {
                file: "ibis/__init__.py",
                hasChanged: true,
                numMatches: 1,
                numReplacements: 1
              }
            ],
            countMatches: true
          }
        ]
      }
    ],
    [
      "@semantic-release/exec",
      {
        verifyConditionsCmd:
          "ci/release/verify_conditions.sh ${options.dryRun}",
        verifyReleaseCmd: "ci/release/verify_release.sh ${nextRelease.version}",
        prepareCmd: "ci/release/prepare.sh ${nextRelease.version}",
        publishCmd: "ci/release/publish.sh"
      }
    ],
    [
      "@semantic-release/github",
      {
        successComment: false,
        assets: ["dist/*.whl"]
      }
    ],
    [
      "@semantic-release/git",
      {
        assets: [
          "pyproject.toml",
          "docs/release_notes_generated.qmd",
          "ibis/__init__.py"
        ],
        message: "chore(release): ${nextRelease.version}"
      }
    ]
  ]
};

